import{_ as g}from"./plugin-vue_export-helper-c27b6911.js";import{r as l,o as p,c as o,a as r,b as i,f as t,d as e,e as s}from"./app-6513a715.js";const h={},n=i("p",null,[i("strong",null,"那結山"),t("，又稱那是山，海拔1520公尺，為復興三尖的老么，位於桃園市復興區與新竹縣尖石鄉交界，有顆二等三角點No.1532，山頂西北向稍有展望，而山頂前之大石山頂則視野極佳。")],-1),m=i("p",null,"那結山有羅馬公路嘎色鬧、北橫內奎輝、北橫大灣及尖石水田林道四處登山口，今日利用年度休假，走走又濕又陡且以螞蝗多而聞名的嘎色鬧路線，沿途亂石崎嶇、陡峭岩壁，極具挑戰性，必須小心行走，所幸今日天氣晴朗、山徑不會濕滑，全程未發現螞蝗，來回約6小時完成。",-1),b=s('<p>走走日期：2015/12/23</p><h2 id="行車路線" tabindex="-1"><a class="header-anchor" href="#行車路線" aria-hidden="true">#</a> 行車路線</h2><p>國道3號下關西交流道，取左沿118縣道往關西方向行駛，進入市區過台3線後續往羅孚行駛(羅馬公路)，至118縣道51.8Km右轉「農桃復9」產業道路往嘎色鬧，約行5Km經過嘎色鬧獵人學校，續往前行駛約200公尺，左轉狹窄的水泥產道，約行1.3Km至鐵皮屋工寮，停車於前方十餘公尺右側空地。</p><h2 id="走走路線" tabindex="-1"><a class="header-anchor" href="#走走路線" aria-hidden="true">#</a> 走走路線</h2><p>→鐵皮屋工寮，停車於前方右側空地，後面山頭就是那結山<br><img src="https://1013399.github.io/image-1/54/1110365361_l.jpg" alt="IMGP8963.JPG - 桃園復興那結山" loading="lazy"></p><p>→右側尖聳的山頭應該是1311峰，整裝後出發，沿水泥路續走<br><img src="https://1013399.github.io/image-1/54/1110365447_l.jpg" alt="IMGP8964.JPG - 桃園復興那結山" loading="lazy"></p><p>→登山口，位於產道轉彎處，綁有路條，取左進入竹林<br><img src="https://1013399.github.io/image-1/54/1110365448_l.jpg" alt="IMGP8965.JPG - 桃園復興那結山" loading="lazy"></p><p>→轉為樓梯草石塊山徑，此處較濕滑，可能會有螞蝗<br><img src="https://1013399.github.io/image-1/54/1110365256_l.jpg" alt="IMGP8966.JPG - 桃園復興那結山" loading="lazy"></p><p>→經過大板根樹，途中有叉路可往嘎色鬧山，但未發現<br><img src="https://1013399.github.io/image-1/54/1110364379_l.jpg" alt="IMGP8966A.JPG - 桃園復興那結山" loading="lazy"></p><p>→踩獨木過岩壁<br><img src="https://1013399.github.io/image-1/54/1110361587_l.jpg" alt="IMGP8966B.JPG - 桃園復興那結山" loading="lazy"></p><p>→水源地，有二個大水桶，過溪後陡上<br><img src="https://1013399.github.io/image-1/54/1110365643_l.jpg" alt="IMGP8967-69.JPG - 桃園復興那結山" loading="lazy"></p><p>→休息小空地<br><img src="https://1013399.github.io/image-1/54/1110364978_l.jpg" alt="IMGP8972.JPG - 桃園復興那結山" loading="lazy"></p><p>→經過獵寮<br><img src="https://1013399.github.io/image-1/54/1110362084_l.jpg" alt="IMGP8973.JPG - 桃園復興那結山" loading="lazy"></p><p>→山徑越來越陡<br><img src="https://1013399.github.io/image-1/54/1110364281_l.jpg" alt="IMGP8975-78.JPG - 桃園復興那結山" loading="lazy"></p><p>→窄稜岩石區<br><img src="https://1013399.github.io/image-1/54/1110362473_l.jpg" alt="IMGP8979.JPG - 桃園復興那結山" loading="lazy"></p><p>→拉繩上岩壁，一路陡上<br><img src="https://1013399.github.io/image-1/54/1110365166_l.jpg" alt="IMGP8980-83.JPG - 桃園復興那結山" loading="lazy"><br><img src="https://1013399.github.io/image-1/54/1110365451_l.jpg" alt="IMGP8984-87.JPG - 桃園復興那結山" loading="lazy"><br><img src="https://1013399.github.io/image-1/54/1110360521_l.jpg" alt="IMGP8988-91.JPG - 桃園復興那結山" loading="lazy"></p><p>→叉路，左可往拉號山、北橫大灣登山口，取右往那結山<br><img src="https://1013399.github.io/image-1/54/1110360522_l.jpg" alt="IMGP8992.JPG - 桃園復興那結山" loading="lazy"></p><p>→鞍部空地叉路，左往拉號山、榮華山、北橫大灣，右往那結山，於此休息<br><img src="https://1013399.github.io/image-1/54/1110362474_l.jpg" alt="IMGP8994.JPG - 桃園復興那結山" loading="lazy"></p><p>→休息後續行往那結山，開始下坡<br><img src="https://1013399.github.io/image-1/54/1110362797_l.jpg" alt="IMGP8995-96.JPG - 桃園復興那結山" loading="lazy"></p><p>→下至低鞍<br><img src="https://1013399.github.io/image-1/54/1110365084_l.jpg" alt="IMGP8997.JPG - 桃園復興那結山" loading="lazy"></p><p>→又繼續陡上<br><img src="https://1013399.github.io/image-1/54/1110365167_l.jpg" alt="IMGP8998-01.JPG - 桃園復興那結山" loading="lazy"></p><p>→上至小山頭<br><img src="https://1013399.github.io/image-1/54/1110365372_l.jpg" alt="IMGP9002.JPG - 桃園復興那結山" loading="lazy"></p><p>→小下坡後再陡上至第二個山頭<br><img src="https://1013399.github.io/image-1/54/1110364482_l.jpg" alt="IMGP9003-06.JPG - 桃園復興那結山" loading="lazy"></p><p>→那結山就在前方了<br><img src="https://1013399.github.io/image-1/54/1110363784_l.jpg" alt="IMGP9007.JPG - 桃園復興那結山" loading="lazy"></p><p>→經過大岩壁，繼續長陡上<br><img src="https://1013399.github.io/image-1/54/1110364284_l.jpg" alt="IMGP9008-13.JPG - 桃園復興那結山" loading="lazy"></p><p>→到達第三個小山頭，樹上有紅色加油釘牌<br><img src="https://1013399.github.io/image-1/54/1110365269_l.jpg" alt="IMGP9014.JPG - 桃園復興那結山" loading="lazy"></p><p>→陡下至低鞍<br><img src="https://1013399.github.io/image-1/54/1110365270_l.jpg" alt="IMGP9015.JPG - 桃園復興那結山" loading="lazy"></p><p>→陡上岩壁<br><img src="https://1013399.github.io/image-1/54/1110362799_l.jpg" alt="IMGP9016.JPG - 桃園復興那結山" loading="lazy"></p><p>→至第四山頭<br><img src="https://1013399.github.io/image-1/54/1110362800_l.jpg" alt="IMGP9018.JPG - 桃園復興那結山" loading="lazy"></p><p>→再陡下後，最後攻頂，攀爬極陡峭壁<br><img src="https://1013399.github.io/image-1/54/1110362801_l.jpg" alt="IMGP9019-22.JPG - 桃園復興那結山" loading="lazy"></p><p>→上至那結山前之大石山頂，三角點在前方不遠處<br><img src="https://1013399.github.io/image-1/54/1110362092_l.jpg" alt="IMGP9023.JPG - 桃園復興那結山" loading="lazy"></p><p>→此處展望極佳，以手機拍攝全景圖<br><img src="https://1013399.github.io/image-1/54/1110363481_l.jpg" alt="IMAG0062.jpg - 桃園復興那結山" loading="lazy"></p><p>→續行小下坡至低鞍叉路，左可往內、外鳥嘴山，續直行<br><img src="https://1013399.github.io/image-1/54/1110362483_l.jpg" alt="IMGP9024.JPG - 桃園復興那結山" loading="lazy"></p><p>→那結山山頂<br><img src="https://1013399.github.io/image-1/54/1110365374_l.jpg" alt="IMGP9025.JPG - 桃園復興那結山" loading="lazy"></p><p>→那結山二等三角點No.1532<br><img src="https://1013399.github.io/image-1/54/1110362486_l.jpg" alt="IMGP9026-27.JPG - 桃園復興那結山" loading="lazy"></p><p>→往西北方向俯瞰大溪、平鎮、八德地區，在此午餐休息<br><img src="https://1013399.github.io/image-1/54/1110360528_l.jpg" alt="IMGP9029.JPG - 桃園復興那結山" loading="lazy"></p><p>→餐畢，原路下山<br><img src="https://1013399.github.io/image-1/54/1110365658_l.jpg" alt="IMGP9030.JPG - 桃園復興那結山" loading="lazy"></p><p>→回到鞍部空地叉路，休息後取左下<br><img src="https://1013399.github.io/image-1/54/1110365659_l.jpg" alt="IMGP9031.JPG - 桃園復興那結山" loading="lazy"></p><p>→回到水源地<br><img src="https://1013399.github.io/image-1/54/1110365085_l.jpg" alt="IMGP9034.JPG - 桃園復興那結山" loading="lazy"></p><p>→回到登山口，取右回停車處<br><img src="https://1013399.github.io/image-1/54/1110362487_l.jpg" alt="IMGP9039.JPG - 桃園復興那結山" loading="lazy"></p><h2 id="走走資訊" tabindex="-1"><a class="header-anchor" href="#走走資訊" aria-hidden="true">#</a> 走走資訊</h2><div class="hint-container info"><p class="hint-container-title">相關信息</p><p>走走時間：約6小時(含休息、午餐)</p><p>高低落差：約690公尺(不含上下起伏)</p></div><h2 id="參考地圖" tabindex="-1"><a class="header-anchor" href="#參考地圖" aria-hidden="true">#</a> 參考地圖</h2>',43),c={href:"http://blog.xuite.net/tinyiliu/ant/20322210",target:"_blank",rel:"noopener noreferrer"},d=i("br",null,null,-1),G=i("img",{src:"https://1013399.github.io/image-1/54/1110360990_l.jpg",alt:"復興那結山(ant).jpg - 桃園復興那結山",loading:"lazy"},null,-1);function P(_,u){const a=l("ExternalLinkIcon");return p(),o("div",null,[n,m,r(" more "),b,i("p",null,[t("原圖連結→"),i("a",c,[t("安替的生活創作日誌"),e(a)]),d,G])])}const I=g(h,[["render",P],["__file","post-54-2015-12-25.html.vue"]]);export{I as default};
